import { makeAutoObservable } from 'mobx'

class CanvasState {
	canvas = null
	undoList = []
	redoList = []
	constructor() {
		makeAutoObservable(this)
	}
	setCanvas(canvas) {
		this.canvas = canvas
	}
	pushToUdo(data) {}
	pushToRedo(data) {}
}

export default new CanvasState()
